@vonHolzhausen @Tesla It's a Citicar. Made in mid 70s outta Florida company. A local Minneapolis microcar collector has one.

4,444 units were produced up to 1979, the most since 1945 for an electric car assembled in North America until surpassed by the Tesla Model S.

